! INCONTOURNABLE ! EPOUSTOUFLANT ! Une véritable CITY dédiée au STREET ART. Une déambulation au fil d’une centaine de fresques murales monumentales.Dans cette cité, les rêves ne se réalisent pas, ils se peignent. De couleurs vives et en tracés subtils. Une oasis artistique. Un paradis pictural où son Adam et Eve ont créé un foyer pour les Artistes du monde entier et un lieu de pèlerinage pour tous les Amoureux de l\'Art Urbain. \r\n\r\nEt5000m2 d’espaces intérieurs. Expositions scénographiées. Galeries.','STREET ART CITY, Les Bruyères de Béguin, 03320 Lurcy-Lévis, France','activité en Allier',2.9191007,46.7194362,'2022-11-29',26,58,36,'03320',1),(47,'Spa excellence des sens','Espace de bien être ou l\'on traite le corps dans sa globalité par le massage, le drainage.  Le Massage Suédois intuitif soulageant les tensions musculaires et améliorant le drainage du corps. Le Massage profond utilisant des mobilisations, des étirements et un travail sur les fascias permettant ainsi aux muscles de se relâcher plus aisément. Idéal pour libérer les tensions et soulager les douleurs chroniques.','Gustavia 97133, Saint-Barthélemy','activité, activite, actvites,',-62.8294264,17.9017005,'2022-11-30',27,64,35,'97133',1),(48,'Le spa du Lodge Roche Tamarin','Afin de vous accorder une parenthèse dans le temps dans un cadre unique, village nature est un lieu conçu pour votre bien-être au cœur d’un jardin tropical, afin de vous permettre de recueillir les bienfaits de soins exceptionnels et ressentir le bien être du corps et de l’esprit. Niché sur les hauteurs, à quelques minutes de la ville de la Possession, le Lodge Roche Tamarin et Spa  vous invite à l’évasion dans une ambiance fusionnant le safari-chic sud-africain et la richesse et beauté de la nature verdoyante réunionnaise. Certifié écolabel européen depuis 2018, le Lodge Roche Tamarin et son Spa s’inscrivent dans le mouvement de l’écotourisme en prenant une petite place dans la nature tout en respectant sa biosphère et son é