INSERT INTO `igoMaster_etablishmentsubtype` VALUES (1,'Cabanes dans les arbres','S’endormir au plus près des étoiles, se réveiller avec le chant des oiseaux et être surpris par un écureuil qui vous regarde depuis sa branche, quoi de plus bienfaisant que ce retour en enfance  dans une cabane en bois, perchée en hauteur...','0000-00-00',1,'heb/cabane_arbres.png'),(2,'Cabanes sur terre','Les cabanes sont uniques, chacune dans leur style et souvent construites en fonction de leur environnement. Elles permettent au plus petits comme aux plus âgés de vivre un rêve éveillé. ','0000-00-00',1,'heb/cabane_sur_terre.png'),(3,'Cabanes sous terre','Cette sensation étrange que l’on peut éprouver en habitant une caverne, une grotte ou une demeure aménagée dans le roc donne aux habitats troglodytes ce côté rassurant et chaleureux d’une demeure solide.','0000-00-00',1,'heb/cabane_sous_terre.png'),(4,'Cabanes sur l\'eau','Les séjours dans les cabanes sur l\'eau sont souvent  très agréables car ils sont  au calme, en pleine nature pour pouvoir admirer un magnifique ciel étoilé, écouter les grenouilles et les divers oiseaux...','0000-00-00',1,'heb/cabane_sur_l_eau.png'),(5,'Tipis - tentes - yourtes','Une nuit insolite en tipi indien ou dans une yourte permet d\'apprécier l’atmosphère unique de ces habitats nomades avec leurs lits surbaissés, les grands tapis, les coussins colorés et les couettes moelleuses. ','0000-00-00',1,'heb/tipis_tente_yourte.png'),(6,'Bulles','Dormir à la belle étoile, à l’abri des intempéries sous un toit transparent pour profiter d’une immersion en pleine nature, avec une vue à 360° ! Des bulles, des dômes, des pyramides… tout en transparence pour ne faire qu’un avec la nuit.','0000-00-00',1,'heb/bulle.png'),(7,'Habitats roulants','Ce mode d’habitation est synonyme de liberté. Alors que les roulottes étaient pour les gitans, tziganes et autres nomades un moyen de locomotion autant que de lieu de vie, aujourd\'hui vous pouvez en profiter pour la nuit !','0000-00-00',1,'heb/habitat_roulant.png'),(8,'Monuments Historiques','Vous y trouverez châteaux, abbayes, phares et maisons historiques transformées aujourd\'hui en hébergements ou chambres d\'hôtes. Amateurs d’histoires et de bâtis anciens? Ces hébergements sont idéal pour des séjours authentiques!','0000-00-00',1,'heb/monument_historique.png'),(9,'Bateaux','Alors que chercher à dormir dans un bateau ne coule pas de source, c’est pourtant un moyen très ressourçant pour une soirée en amoureux ou un week-end entre amis...','0000-00-00',1,'heb/bateau.png'),(10,'Hébergements de charme','La chambre d’hôte est un mode d’hébergement pour les personnes qui recherchent la proximité, la convivialité et le bien être. Souvent, on peut aussi profiter du jardin et de la piscine. Les propriétaires aiment accueillir chez eux !','0000-00-00',1,'heb/hébergements_de_charme.png'),(11,'Hôtels atypiques','Certains hôtels  sont atypiques, hors du commun, fascinants et inhabituels par leur forme, leur décoration et leur ambiance. Souvent accompagnés par des décorateurs d’intérieurs plus originaux les uns que les autres, profitez-en !','0000-00-00',1,'heb/hotels_atypiques.png'),(12,'Bars lounges - Whiskies - Cocktails','Souvent dans une atmosphère calfeutrée et propice à la dégustation, les lieux proposent généralement la dégustation de whiskies, du single malt à une sélection impressionnante de scotchs aussi nombreuse que variée.  ','0000-00-00',2,'oub/bar_whiskies.png'),(13,'Bars rooftop','Du dernier étage d’un gratte-ciel en passant par une terrasse romantique, les bars rooftops avec leur vue spectaculaire proposent aussi bien des dîners sophistiqués qu’un joli cocktail, une soirée électro ou un moment fun en famille. ','0000-00-00',2,'oub/bar_rooftop.png'),(14,'Bars à vins','C’est le week-end ! Les vacances ! Alors pourquoi ne pas se retrouver entre amis, amoureux ou en famille autour d’un verre de vin ?','0000-00-00',2,'oub/bar_vin.png'),(15,'Pubs - Bars à Tapas','Se retrouver entre amis pour se détendre autour d’un verre accompagné de tapas, rien de plus convivial! Ou peut-être un pub irlandais traditionnel décoré d’éléments en bois sombres serait plus adapté?','0000-00-00',2,'oub/bar_pubs _ tapas.png'),(16,'Bar à thèmes - Jeux - Billard','Depuis un certain temps, le phénomène des bars à thème ne cesse de s’intensifier en France. Ces bars, malgré leurs appellations, ne proposent pas tous des boissons alcoolisées, mais plutôt des ambiances comme celle des jeux vidéo et autres jeux...   ','0000-00-00',2,'oub/bar_billard.png'),(17,'Concerts Bars','S’amuser, se détendre en assistant à des concerts de jazz, Blues, Rock, countries… avec des saxophonites, pianistes, chanteurs…nombreux sont les bars qui offrent ce genre de concert dans tous les styles de musique!','0000-00-00',2,'oub/concert_bar.png'),(18,'Bars à Chats','Les petits félins sont une grande passion et la gourmandise un très joli défaut ?  On peut se détendre entre calme et relaxation avec son animal préféré ! ','0000-00-00',2,'oub/bar_chat.png'),(19,'Restaurants originaux','De nombreux restaurants proposent pour les soirées de fête entre amis ou d\'anniversaire, des animations avec certains concepts assez hors normes pour séduire les clients !','0000-00-00',3,'oum/restaurants_originaux.png'),(20,'Restaurants avec animation','Une soirée avec animation est une manière d’offrir une expérience unique et différente aux clients, de souder les équipes de travail, de divertir les amis et de s’amuser en famille. Bien sûr, un groupe de musique est l’animation en général !','0000-00-00',3,'oum/restaurants_annimation.png'),(21,'Brasseries - Bistrots - Auberges','Si, au départ, le bistro avec tables en bois ou zinc et nappes vichy, se voulait modeste et sans prétention, à présent, ils proposent des espaces généralement ouverts, conviviaux et modernes. Le design y a pris une place importante !','0000-00-00',3,'oum/brasserie_bistrot.png'),(22,'Cuisine traditionnelle','La cuisine traditionnelle française fait référence à divers styles gastronomiques dérivés de la culture française. Chaque région, parfois même chaque département, regorge de recettes traditionnelles souvent transmises de génération en génération. ','0000-00-00',3,'oum/cuisine_traditionnelle.png'),(23,'Cuisine du monde','On aurait envie de se changer les idées et partir ailleurs manger une cuisine aux saveurs exotiques! On peut voyager et se faire un petit tour du monde à travers les cuisines asiatique, orientale, américaine et européenne.','0000-00-00',3,'oum/cuisine_monde.png'),(24,'Type fast-food - Tapas','Ce type de restauration est axé sur la rapidité, à toute heure et pour un prix peu élevé, qui peuvent être consommés sur place ou emportés sous emballage. On y retrouve les food-trucks et les traditionnels enseignes d’hamburgers, des kebabs, de pizza','0000-00-00',3,'oum/type_fast_food.png'),(25,'Au fil de l\'eau','Il y a mille et une façon de se balader et celle où on glisse sur l’eau est tout de même, une des plus agréable, il faut bien le dire ! A bord d’un canoë, kayak ou paddle à deux, en famille ou entre amis, vivre une expérience 100 % nature !','0000-00-00',4,'bal/au_fil_de_l_eau.png'),(26,'Randonnées natures','Randonner, c\'est voyager à son propre rythme, se retrouver au cœur de la nature et des routes pittoresques qui mènent à des trésors insoupçonnés. On peut en profiter pour aller à la pêche des perles sauvages à pied, à vélo ou à cheval, en solo, en fa','0000-00-00',4,'bal/randonnées_nature.png'),(27,'Sites historiques','Se balader, c’est aussi découvrir  les joyaux architecturaux d’une ville dans laquelle il fait bon entamer une balade historique à travers les siècles.  ','0000-00-00',4,'bal/monuments_hsitoriques.png'),(28,'Les perles sauvages','Ces balades offrent un environnement naturel exceptionnel. Si on souhaite etre dans secteur sauvage, il existe de nombreux lieux remarquables avec des randonnées absolument fabuleuses à faire!','0000-00-00',4,'bal/perles_sauvages.png'),(29,'Les jardins imaginaires','Ces jardins sont dessinés avec des lignes architecturales très contemporaines, illustrations de la manière dont l’homme dialogue avec la Nature. Les parcours proposent comme des tableaux avec des voûtes parfumées faites de houblon, de glycine, de jas','0000-00-00',4,'bal/jardins_imaginaire.png'),(30,'Ateliers et stages','Envie d\'une activité pour quelques jours ou pour toute l’année? Que ce soit les activités sportives ou manuelles, que l\'on soit un artisan, un créatif ou un artiste dans l\'âme, on peut toujours apprendre à faire quelque chose...','0000-00-00',5,'act/ateliers_stage.png'),(31,'Activités physiques et sportives','L’activité physique vise à améliorer essentiellement sa condition physique et se présente sous forme de jeux individuels ou collectifs, donnant généralement lieu à  des compétitions mais pas seulement. On sait bien que la pratique régulière d\'un spor','0000-00-00',5,'act/activités_sportives.png'),(32,'Activités ludiques','Les activités ludiques sont souvent des activités qui concernent les enfants mais pas que !','0000-00-00',5,'act/activités_ludiques.png'),(33,'Activités gustatives','Vous avez envie de faire une activité dans l’univers de la cuisine ou encore, vous cherchez à faire des dégustations ? Il y a beaucoup de façons de déguster les produits ! Souvent, les artisans vous font découvrir l’amour de leurs produits de terroir','0000-00-00',5,'act/activités_gustatives.png'),(34,'Activités éducatives','On peut toujours en apprendre plus. Pour visiter, en prendre plein les yeux, découvrir de nouvelles choses, revenir sur des souvenirs, sentir, voir, toucher, entendre…Il est  toujours satisfaisant de se “coucher le soir moins bête…” ! ','0000-00-00',5,'act/activité_educative.png'),(35,'Activités bien-être','Lorsque l’on éprouve cet état, cette sensation de bien-être, c’est que la satisfaction des besoins du corps et le calme de l\'esprit sont atteints.  On  peut les retrouver grâce aux massages, au yoga ou dans des ateliers de développement personnel.','0000-00-00',5,'act/activités_bien_etre.png'),(36,'Shopping artisans et créateurs','Retrouvez ici, des boutiques de créateurs partout où vous serez en France. Trouvez des artistes créateurs  pour faire du shopping de façon créative !','0000-00-00',5,'act/shopping_artisans_créateurs.png'),(37,'Organisateurs','L\'organisateur est celui qui régie la conception d\'un événement de bout en bout, mais pas obligatoirement. Il peut s’occuper des préparatifs, de l\'organisation matérielle d\'un événement, du mariage à l’anniversaire en passant par la réception...','0000-00-00',6,'ser/organisateurs.png'),(38,'Photographes','C’est un professionnel de l\'image et il existe plusieurs types de photographes. Créatif, il propose de réaliser des prises de vue dans les domaines de la mode, du mariage, du paysage...Souvent on peut faire appel à un photographe/vidéaste aussi !','0000-00-00',6,'ser/photographe.png'),(39,'Traiteurs','Pour confectionner le repas idéal ou créer son évènement gourmand, le savoir-faire des traiteurs permet la qualité et les produits travaillés sont les ingrédients d’une soirée réussie. Le traiteur se déplace et conceptualise le repas sur place !','0000-00-00',6,'act/traiteur.png'),(40,'Fleuristes','Les fleuristes assemblent chaque bouquet avec amour pour donner le meilleur de leur art. Les fleurs peuvent être livrées par de véritables artisans qui savent réaliser une composition florale ! Faites vous plaisir !','0000-00-00',6,'ser/fleuriste.png'),(41,'Locations de véhicules','Une voiture de location au meilleur prix, avec un large choix de modèles de voitures et d’utilitaires. Tous les choix s\'offrent suivant les besoins de location: Economique, Mini, Compacte, Monospace, Intermédiaire, Premium, 4x4, Break, SUV! Souvent l','0000-00-00',6,'ser/location_voiture.png'),(42,'Locations de vélos','La tendance actuelle voudrait que l’on puisse se déplacer sans encombrement et visiter, se faire une balade, une randonnée ou du sport, sans avoir à se préoccuper de charger ou stocker un vélo. Il y a des magasins de location de tout type ! ','0000-00-00',6,'ser/location_velo.png'),(43,'Divers','IGOguide a pensé à tous les petits détails qui permettent aux utilisateurs de pouvoir s’organiser pendant leur soirée, week-end ou vacances! Cette catégorie permet de rassembler des entreprises qui facilitent le quotidien très utiles !','0000-00-00',6,'ser/divers_pressing.png');
