INSERT INTO `igoMaster_etablishmenttype` VALUES (1,'Hebergements','Des nuits atypiques, c\'est assuré...insolites, c\'est probable...et des nuits magiques, c\'est certain ! L\'univers que les hôtes ont créé est inventif et rend ces moments inoubliables.','0000-00-00','#279fdb','hebergements.jpg'),(2,'Où boire?','Se retrouver entre amis ou en couple pour le simple plaisir d\'être ensemble.','0000-00-00','#bb218f','bars.jpg'),(3,'Où manger?','Parfois on testerait bien de nouvelles expériences, surtout dans notre assiette !','0000-00-00','#dd1406','restaurants.jpg'),(4,'Balades','Des idées de promenades et des itinéraires de randonnées pour une bonne bouffée d\'air.','0000-00-00','#76a509','balades.jpg'),(5,'Activités','Trouvez l\'activité qui correspond à vos besoins.','0000-00-00','#ff8100','activités.jpg'),(6,'Services','Et si pour animer votre soirée ou rendre votre séjour inoubliable, vous faisiez appel aux services de professionnels ? Besoin d\'un photographe ? D\'un traiteur ? D\'une location de voiture ? D\'un fleuriste peut-être !','0000-00-00','#ffc823','services.jpg');
